import First from "../assets/tdog.png"
import Second from "../assets/Second.jpg"



export const SliderData = [
    {
        title: "Landing Pages",
        description: "Crie a sua própria página para conversão de clientes. Esse serviço visa a criação de uma página que terá a descrição da sua oferta, imagem chamativa, butoes CTA e/ou formulários!",
        urls: First
    },
    {
        title: "Site Profissional",
        description: "Um site capaz de abrigar todas as informações da sua empresa ou persona profissional. Aqui você terá o número de páginas que desejar, barra de navegação interativa, design moderno e responsivo.",
        urls: Second
    },
   
]
